import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

import { Modal, Button, Form, Col } from "react-bootstrap";

import { MdPerson } from "react-icons/md";




import "./contactform.css"

class ContactForm extends Component {
    SubmitData55 = this.SubmitData55.bind(this);

    state = {
        showsign: true

    };
    componentDidMount() {

    }
    updateEmail = (e) => {
        e.preventDefault();


    };

    // handleClose = () => setShow(false);
    //  handleShow = () => setShow(true);

    // handleRegister=()=> this.setState({showRegister: true,
    //     showsign: false});

    handelsubmit = (event) => {
        event.preventDefault();


    };

    handelchange = (e) => {

    };


    handleRegister = () => {

    };

    SubmitData55(e) {
        e.preventDefault();


    }
    close = () => {
        this.setState({ errflag: false });
    };

    render() {




        return (
            <React.Fragment>



                <Modal show={this.state.showsign} className="setLogin" onHide={() => this.setState({ showsign: false })}>
                    <Modal.Header bsPrefix="modal-header " className="d-block">
                        <Modal.Title>
                            <MdPerson className="signup2" style={{ color: 'golden-rod' }} /> Contact Information
            </Modal.Title>
                    </Modal.Header>
                    <Modal.Body>
                        <span style={{ color: "grey", textAlign: 'center' }}>To get your offer, please take the time to fill out the information below.</span>
                        <br></br>
                        <Form
                            onSubmit={this.SubmitData5}
                            id="myForm"
                            className="form"
                            ref={(form) => (this.messageForm = form)}
                        >
                            <Form.Row>
                                <Form.Group as={Col}>
                                    <Form.Label>Name</Form.Label>
                                    <Form.Control
                                        value={this.state.Name}
                                        onChange={this.updateName.bind(this)}
                                        placeholder="Enter email"
                                    />
                                </Form.Group>

                                <Form.Group as={Col} controlId="formGridPassword">
                                    <Form.Label>Image</Form.Label>
                                    <Form.Control
                                        type="file"
                                        placeholder="Image"
                                        onChange={this.captureFile}
                                    />
                                </Form.Group>
                            </Form.Row>
                            <Form.Row>
                                <Form.Group as={Col} controlId="formGridEmail">
                                    <Form.Label>Email</Form.Label>
                                    <Form.Control
                                        type="email"
                                        value={this.state.Email}
                                        onChange={this.updateEmail.bind(this)}
                                        placeholder="Enter email"
                                    />
                                </Form.Group>

                                <Form.Group as={Col} controlId="formGridPassword">
                                    <Form.Label>Password</Form.Label>
                                    <Form.Control
                                        type="password"
                                        value={this.state.password}
                                        onChange={this.updatePassword.bind(this)}
                                        placeholder="Password"
                                    />
                                </Form.Group>
                            </Form.Row>

                            <Form.Group as={Col} controlId="formGridAddress1">
                                <Form.Label>Address</Form.Label>
                                <Form.Control
                                    value={this.state.Address}
                                    onChange={this.updateAddress.bind(this)}
                                    placeholder="1234 Main St"
                                />
                            </Form.Group>

                            <Form.Row>
                                <Form.Group as={Col} controlId="formGridCountry">
                                    <Form.Label>Country</Form.Label>
                                    <Form.Control
                                        placeholder=""
                                        value={this.state.Country}
                                        onChange={this.updateCountry.bind(this)}
                                    />
                                </Form.Group>
                                <Form.Group controlId="formGridCity">
                                    <Form.Label>City</Form.Label>
                                    <Form.Control
                                        value={this.state.City}
                                        onChange={this.updateCity.bind(this)}
                                        placeholder=""
                                    />
                                </Form.Group>
                            </Form.Row>
                            <Form.Row>


                            </Form.Row>
                            <Button
                                variant="primary"
                                className="chkbtn"
                                type="submit"
                                d
                            >
                                Submit
              </Button>
                        </Form>


                    </Modal.Body>
                    <Modal.Footer>
                        <Button
                            variant="secondary"
                            onClick={
                                this.props.close
                            }
                            className="chkbtn"
                        >
                            Close
            </Button>
                    </Modal.Footer>
                </Modal>

            </React.Fragment>
        );
    }
}

export default ContactForm;
